import ImagenesBody from "../Helper/ImagenesBody";


const Imagenes = () => {

    return (
        <div>
            {
                ImagenesBody.map((imgSrc, index) => (<img src={imgSrc.src} key={index} alt='Imagenes Suca'/>))}
        </div>
    )
};

export default Imagenes;
